import React from "react";
import { GiHamburgerMenu } from "react-icons/gi";

import {
  HamburgerButtonContainer,
  HamburguerButtonTextContainer,
} from "./hamburger-button.styles";

const HamburguerButton = (props) => {
  return (
    <HamburgerButtonContainer
      className="hamburger__button"
      onClick={props.click}
    >
      <GiHamburgerMenu size={20} />
      <HamburguerButtonTextContainer className="hamburger__text">
        All
      </HamburguerButtonTextContainer>
    </HamburgerButtonContainer>
  );
};

export default HamburguerButton;
